def transform(sequence):
    count = {}
    for num in sequence:
        if num in count:
            count[num] += 1
        else:
            count[num] = 1

    max_num = max(count, key=lambda x: (count[x], -x))

    transformed_sequence = [0] * count[0] + [max_num] * count[max_num]

    return transformed_sequence
